    public void ShouldGenerateKeyCorrectly(KyberParameterSet kyberParameterSet, string zHex, string dHex, string ekHex, string dkHex)
    {
        var z = new BitString(zHex).ToBytes();
        var d = new BitString(dHex).ToBytes();
        var ek = new BitString(ekHex).ToBytes();
        var dk = new BitString(dkHex).ToBytes();
        
        var kyberParameters = new KyberParameters(kyberParameterSet);
        var kyber = new Kyber(kyberParameters, new NativeShaFactory());

        var key = kyber.GenerateKey(z, d);
        
        Assert.AreEqual(ek, key.ek, "ek");
        Assert.AreEqual(dk, key.dk, "dk");
    }

