    public void ShouldEncapsulateCorrectly(KyberParameterSet parameters, string seedMHex, string ekHex, string cHex, string kHex)
    {
        var ek = new BitString(ekHex).ToBytes();
        var seedM = new BitString(seedMHex).ToBytes();
        var expectedSharedSecretK = new BitString(kHex).ToBytes();
        var expectedCiphertextC = new BitString(cHex).ToBytes();

        var kyberParameters = new KyberParameters(parameters);
        var kyber = new Kyber(kyberParameters, new NativeShaFactory());

        var sharedSecret = kyber.Encapsulate(ek, seedM);
        
        Assert.AreEqual(expectedSharedSecretK, sharedSecret.K, "K");
        Assert.AreEqual(expectedCiphertextC, sharedSecret.c, "c");
    }
    
