    public void ShouldDecapsulateCorrectly(KyberParameterSet parameters, string dkHex, string cHex, string kHex)
    {
        var dk = new BitString(dkHex).ToBytes();
        var c = new BitString(cHex).ToBytes();
        var expectedSharedSecretK = new BitString(kHex).ToBytes();

        var kyberParameters = new KyberParameters(parameters);
        var kyber = new Kyber(kyberParameters, new NativeShaFactory());

        var sharedSecret = kyber.Decapsulate(dk, c);
        
        Assert.AreEqual(expectedSharedSecretK, sharedSecret.sharedKey, "K");
    }
